import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
  root: {
    width: "100%",
  },
  container: {
    maxHeight: 600,
  },
  link: {
    textDecoration: "none",
  },
});

export default useStyles;
